    font-size: 1.5rem;
    margin-left: 2rem;
    padding: -1rem;


`
const Category = styled.div`
    background-color: blue;

`
const Search= ()=>{
    return(
        <SearchTab>
        <Category>
        <Title>Categories</Title>
                <ColoredLine/>
        </Category>

        </SearchTab>
    )
}
export default Search
